const unlockButtons=()=>{const unlockX=ID=>{document.getElementById(ID).classList.remove("btn-disabled")};const handleEventButtons=[UIIds.setPrefsId,UIIds.resetPrefsId,UIIds.startButtonId,UIIds.setEventSettingsId];handleEventButtons.forEach(e=>unlockX(e));document.getElementById(UIIds.setEventSettingsId).parentElement.children[1].textContent="General "+ScriptName+" settings."};const resetSettings=()=>{const data=getLocalStorage(StorageIds.globalData);if(data){data.EventSettings=null}printSuccess("Settings have been reset")};const saveSettings=()=>{const getSaved=getLocalStorage(StorageIds.globalData);if(getSaved===globalData){printError("Nothing to save.");return}saveLocalStorage(StorageIds.globalData,globalData);printSuccess("Settings successfully saved")};unlockButtons();const startStopBot=()=>{const savedData=getLocalStorage(StorageIds.globalData);savedData.running=!savedData.running;document.getElementById(UIIds.startButtonId).innerText=savedData.running?"Stop":"Start";saveLocalStorage(StorageIds.globalData,savedData);savedData.running?start():{}};document.getElementById(UIIds.setEventSettingsId).addEventListener("click",async function(){$.ajax({type:"GET",url:"https://rawcdn.githack.com/Tribalwars-Scripts/Events/"+ScriptVersion+"/HoldSectorsEvent/settings.min.js?min=1",dataType:"script",cache:false})});document.getElementById(UIIds.resetPrefsId).addEventListener("click",async function(){resetSettings()});document.getElementById(UIIds.setPrefsId).addEventListener("click",async function(){saveSettings()});document.getElementById(UIIds.startButtonId).addEventListener("click",async function(){startStopBot()});const start=async()=>{const saveData=getLocalStorage(StorageIds.globalData);const isStart=async()=>{};saveData.running?await isStart():{}};setTimeout(start,5e4);